import React from "react";
import MealTypeStatic from "./data/MealTypeStatic";
import styles from "./recipe.module.css";

const Recipe = () => {
  const recipeObj = MealTypeStatic[1];
  return (
    <>
      <div className="container">
        <div className="row">
          <div className="col-5">
            <img className={styles.recipe} src={recipeObj.image}></img>
          </div>
          <div className="col-7">
            <p>Words</p>
          </div>
        </div>
        <div className="row">
          <h1>Steps</h1>
        </div>
      </div>
    </>
  );
};

export default Recipe;
